import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

import mobileIcon from './Images/mobile-icon.png';
import fashionIcon from './Images/fashion-icon.png';
import electronicsIcon from './Images/Electrionic-icon.png';
import furnitureIcon from './Images/furniture-icon.png';
import appliancesIcon from './Images/appliances-icon.png';
import store from './Images/99.png';
import Deals from './Images/Deals.png';
import Coming from './Images/Coming.png';

function Navbar() {
  return (
    <nav className='menubar'>
      <ul className="menu-bar">
        <li className="selected">
          <Link to="/deals">
            <img src={Deals} alt="Mobiles" />
            Deals
          </Link>
        </li>
        <li className="selected">
          <Link to="/mobiles">
            <img src={mobileIcon} alt="Mobiles" />
            Mobiles
          </Link>
          <ul className="submenu">
            <li><Link to="/mobiles/smartphones">Smartphones</Link></li>
            <li><Link to="/mobiles/accessories">Accessories</Link></li>
          </ul>
        </li>
        <li className="selected">
          <Link to="/fashion">
            <img src={fashionIcon} alt="Fashion" />
            Fashion
          </Link>
          <ul className="submenu">
            <li><Link to="/fashion/clothing">Clothing</Link></li>
            <li><Link to="/fashion/shoes">Shoes</Link></li>
          </ul>
        </li>
        <li className="selected">
          <Link to="/electronics">
            <img src={electronicsIcon} alt="Electronics" />
            Electronics
          </Link>
          <ul className="submenu">
            <li><Link to="/electronics/laptops">Laptops</Link></li>
            <li><Link to="/electronics/cameras">Cameras</Link></li>
          </ul>
        </li>
        {/* Similarly, add submenus for other main menu items */}
        {/* ... */}
      </ul>
    </nav>
  );
}

export default Navbar;
